// Initial drone position 
let x = 0;
let y = 9;
let direction = 'north';


// Placing the drone on the grid
function placeDrone(newX, newY, newDirection) {
    if (newX >= 0 && newX < 10 && newY >= 0 && newY < 10) {
        x = newX;
        y = newY;
        direction = newDirection;
        updateGrid();
    }
}


// To move the drone
function moveDrone() {
    if (x !== -1 && y !== -1) {
        if (direction == "north") {
            if (y <= 9 && y > 0) {
                y--;
            }
        }
        else if (direction == "south") {
            if (y < 9 && y >= 0) {
                y++;
            }
        }
        else if (direction == "east") {
            if (x < 9 && x >= 0) {
                x++;
            }
        }
        else if (direction == "west") {
            if (x <= 9 && x > 0) {
                x--;
            }
        }
        else {

        }
        placeDrone(x, y, direction);
        //    updateGrid();
    }
}



// To update the grid --- to show the drone's current position
function updateGrid() {
    const cells = document.querySelectorAll('.grid div');
    cells.forEach(cell => {
        cell.classList.remove('drone', 'left', 'right');
        cell.style.backgroundColor = "";
        cell.innerHTML = '';
    });

    const cellIndex = x + y * 10;
    cells[cellIndex].classList.add('drone');

    const droneCell = cells[cellIndex];
    const droneImg = document.createElement('img');

    if (direction == "north") {
        // droneImg.src = './assets/toy-north.png';
        droneImg.src = northImage;

    } else if (direction == "east") {
        // droneImg.src = './assets/toy-east.png';
        droneImg.src = eastImage;
    }
    else if (direction == "west") {
        // droneImg.src = './assets/toy-west.png';
        droneImg.src = westImage;
    }
    else if (direction == "south") {
        // droneImg.src = './assets/toy-south.png';
        droneImg.src = southImage;
    }

    droneCell.appendChild(droneImg);
    console.log(direction);
}



document.getElementById('moveBtn').addEventListener('click', moveDrone);

document.getElementById('placeBtn').addEventListener('click', ()=>{
    document.getElementById("inputForm").style.display="inline";
    document.getElementById("grid").style.display = "none";
    document.getElementById("placeBtn").style.display = "none";
    document.getElementById("info").style.display = "none";

    const actionButtons = document.querySelectorAll('.actionBtn');
    actionButtons.forEach(button => {
        button.style.display = "none";
    });

});

document.addEventListener('keydown', function (event) {
    if (event.key === "ArrowLeft") {
        leftBtnFunction();
    }   
    if (event.key === "ArrowRight") {
        rightBtnFunction();
    }
    if (event.code === "Space" ) {
        attackBtnFunction();
    }
    if (event.key === "ArrowUp") {
        moveDrone();
    }
    if (event.key === "l" || event.key === "L") {
        reportBtnFunction();
    }
});


function leftBtnFunction() {
    switch (direction) {
        case "north": direction = "west";
            break;
        case "south": direction = "east";
            break;
        case "east": direction = "north";
            break;
        case "west": direction = "south";
            break;

        default:
            break;
    }
    updateGrid();
    console.log(direction);
}

function rightBtnFunction() {
    switch (direction) {
        case "north": direction = "east";
            break;
        case "south": direction = "west";
            break;
        case "east": direction = "south";
            break;
        case "west": direction = "north";
            break;

        default:
            break;
    }
    updateGrid();
    console.log(direction);
}


function attackBtnFunction() {
    if (direction == "north") {
        if (y <= 9 && y > 1) {
            y -= 2;
            updateGridOnAttack();
            y += 2;
        }
    }
    else if (direction == "south") {
        if (y < 8 && y >= 0) {
            y += 2;
            updateGridOnAttack();
            y -= 2;
        }
    }
    else if (direction == "east") {
        if (x < 8 && x >= 0) {
            x += 2;
            updateGridOnAttack();
            x -= 2;
        }
    }
    else if (direction == "west") {
        if (x <= 9 && x > 1) {
            x -= 2;
            updateGridOnAttack();
            x += 2;
        }
    }
    else {
    }

}

document.getElementById("leftBtn").addEventListener("click", leftBtnFunction);
document.getElementById("rightBtn").addEventListener("click", rightBtnFunction);
document.getElementById("reportBtn").addEventListener("click", reportBtnFunction);
document.getElementById("attackBtn").addEventListener("click", attackBtnFunction);




function handleGridCellClick(index) {
    const clickedX = index % 10;
    const clickedY = Math.floor(index / 10);
    placeDrone(clickedX, clickedY, direction);

    const actionButtons = document.querySelectorAll('.actionBtn');
    actionButtons.forEach(button => {
        button.style.pointerEvents = 'all';
        button.style.cursor = 'default';
        button.style.opacity = '1';
    });
}


// Initialising the grid ---- for creating the grid
const grid = document.querySelector('.grid');
for (let i = 0; i < 100; i++) {
    const cell = document.createElement('div');
    cell.addEventListener('click', () => handleGridCellClick(i));
    grid.appendChild(cell);
}



